import UIKit

class ViewController: UIViewController,UITableViewDataSource,UITableViewDelegate {

    @IBOutlet weak var tableView: UITableView!
    override func viewDidLoad() {
        super.viewDidLoad()
        self.tableView.hidden = true
        self.parseJson()
        // Do any additional setup after loading the view, typically from a nib.
    }

    override func didReceiveMemoryWarning() {
        super.didReceiveMemoryWarning()
        // Dispose of any resources that can be recreated.
    }


    var country: String = ""
    var capital: String = ""
    var latitude: Double = 0.0
    var longitude: Double = 0.0
    var output:NSArray!

    func parseJson(){

        if let path = NSBundle.mainBundle().pathForResource("capitals", ofType: "json") {

            do {

                let jsonData = try NSData(contentsOfFile: path, options: NSDataReadingOptions.DataReadingMappedIfSafe)

                do {
                    let jsonResult: NSDictionary = try NSJSONSerialization.JSONObjectWithData(jsonData, options: NSJSONReadingOptions.MutableContainers) as! NSDictionary
                    for (key,value) in jsonResult
                    {
                        if key as! String == "Results"
                        {

                            output = value as! NSArray
                        }
                    }

//                    for item in output
//                    {
//                        
//                        capital = item["Capital"] as! String
//                        latitude = item["Latitude"] as! Double
//                        longitude = item["Longitude"] as! Double
//                        
//                    }
//                    

                    dispatch_async(dispatch_get_main_queue()){
                        self.tableView.hidden = false
                        self.tableView.reloadData()
                    }
                   // print(output)

                } catch {}
            } catch {}
        }
    }



    func tableView(tableView: UITableView, cellForRowAtIndexPath indexPath: NSIndexPath) -> UITableViewCell {

        let cell = tableView.dequeueReusableCellWithIdentifier("cell", forIndexPath: indexPath)

        var country:[String] = []
        //var capital: [String] = []

        for item  in output
        {

            //print(item["Country"]!)
            //country.append(item["Country"] as! String)
            country.append(item["Capital"] as! String)
        }

        cell.textLabel?.text = country[indexPath.row]
        //cell.detailTextLabel?.text = capital[indexPath.row]

        return cell

    }

    func tableView(tableView: UITableView, numberOfRowsInSection section: Int) -> Int {


        print(output!.count)
        return output!.count


    }

}
